def clean_string(input_string: str) -> list:
    cleaned_string: str = ''

    for char in input_string:
        if char.isalpha() or char.isspace():
            cleaned_string += char
    return cleaned_string.capitalize().split(' ') # ["asssssd", "qwe", "sadsda", "zxc"]


def restore_string(cleaned_string: list) -> str:
    result: list = []
    for element in cleaned_string:
        string_without_duplicates: str = ""
        prev_letter: str = ""
        for letter in element:
            if letter != prev_letter:
                string_without_duplicates += letter
                prev_letter = letter
        result.append(string_without_duplicates)

    return ' '.join(result)


