# Поиск наиболее повторяющегося элемента в списке
numbers = [1, 3, 4, 2, 2, 3, 4, 2, 5, 2, 4, 4, 4, 4, 4, 4, 4, 4]

# Создаем словарь для подсчета повторений каждого элемента
count_dict = {} # Создаем пустой словарь, который будет использоваться для подсчета повторений каждого элемента:

# Проходим по каждому числу в списке numbers и обновляем словарь count_dict, увеличивая счетчик для каждого числа:
for num in numbers:
  # Здесь мы используем метод .get() для получения текущего значения
  # счетчика числа num в словаре count_dict. Если числа num еще нет в
  # словаре, метод .get() вернет значение по умолчанию, равное 0, и мы
  # увеличим его на 1. Если числа num уже есть в словаре, мы увеличим его текущее значение на 1.
  # В результате этого цикла мы получим словарь count_dict, в котором ключами
  # будут числа из исходного списка, а значениями будут количество повторений каждого числа.
    count_dict[num] = count_dict.get(num, 0) + 1

# Находим элемент с наибольшим количеством повторений:
# Создаем переменные most_common (наиболее повторяющийся элемент)
most_common = None # 1 3 4 2
# и max_count (максимальное количество повторений) со значениями None и 0 соответственно:
max_count = 0 # 1 2 3 4

# Проходим по парам ключ-значение в словаре count_dict:
for num, count in count_dict.items():
  # Здесь мы сравниваем текущее значение счетчика count с максимальным
  # значением max_count. Если текущее значение больше, то обновляем
  # переменные most_common и max_count значениями текущего числа и его количества повторений соответственно.
  # После завершения этого цикла, переменная most_common будет содержать
  # наиболее повторяющийся элемент, а переменная max_count будет содержать его количество повторений.
    if count > max_count:
        most_common = num
        max_count = count

print(f"Наиболее повторяющийся элемент: {most_common}")

