"""Где наши кортежи могут применяться?

* Обработка данных из базы данных: Кортежи могут быть использованы для представления результатов запросов к базе данных. Например, при извлечении данных из таблицы можно использовать кортежи для хранения значений каждой строки. Методы, такие как count() и index(), могут использоваться для анализа и обработки этих данных.
"""

import sqlite3

# Установка соединения с базой данных
conn = sqlite3.connect('employees.db')
cursor = conn.cursor()

# Выполнение запроса к базе данных
cursor.execute("SELECT name, age, salary FROM employees")
result = cursor.fetchall()  # Получение результатов запроса в виде списка кортежей


# [(name, age, salary), (name, age, salary), (name, age, salary), (name, age, salary)]
# Обработка данных
total_salary = 0
for row in result:
    name, age, salary = row
    print(f"Имя: {name}, Возраст: {age}, Зарплата: {salary}")

    total_salary += salary

average_salary = total_salary / len(result)
print(f"Средняя зарплата: {average_salary}")

# Закрытие соединения с базой данных
conn.close()

"""
* Возвращение нескольких значений из функции: Функции в Python могут возвращать кортежи в качестве результата. Например, функция, которая вычисляет минимальное и максимальное значение в списке, может вернуть кортеж из двух значений. Затем можно использовать методы кортежей, такие как count() и index(), для работы с этими значениями."""

def find_min_max(numbers):
    min_value = min(numbers)
    max_value = max(numbers)
    return min_value, max_value

my_numbers = [5, 2, 9, 1, 7]
min_num, max_num = find_min_max(my_numbers)

print(f"Минимальное значение: {min_num}")
print(f"Максимальное значение: {max_num}")

# Использование методов кортежа
min_count = (min_num, max_num).count(min_num)
max_index = (min_num, max_num).index(max_num) # 1, 7

print(f"Количество минимальных значений: {min_count}")
print(f"Индекс максимального значения: {max_index}")

